import React from 'react';

const Ship = (props) => {

	let piratenodes = [];

	for(pirate of props.pirates){
		piratenodes.push(pirate)
	}

	return (
		<div className="component">
			<p className="name">
				{props.ship.name}
			</p>
			<p>Pirates:</p>

			<p className="pirates">
				{piratenodes}
			</p>

		</div>
	)
}

export default Ship;
